using PhotoGallery.Api.Models.Entities;

namespace PhotoGallery.Api.Host.Data;

public static class DbInitializer
{
    public static async Task Initialize(ApplicationDbContext context)
    {
        _ = await context.Database.EnsureCreatedAsync();
        if (!context.Users.Any())
        {
            await context.Users.AddRangeAsync(GetPreconfiguredUsers());

            _ = await context.SaveChangesAsync();
        }

        if (!context.Albums.Any())
        {
            await context.Albums.AddRangeAsync(GetPreconfiguredAlbums(context));

            _ = await context.SaveChangesAsync();
        }

        if (!context.Images.Any())
        {
            await context.Images.AddRangeAsync(GetPreconfiguredImages(context));

            _ = await context.SaveChangesAsync();
        }
    }

    private static IEnumerable<User> GetPreconfiguredUsers()
    {
        var user1 = new User
        {
            Email = "user@gmail.com",
            UserName = "user1",            
            Password = "password1",             
            IsAdmin = false
        };

        var user2 = new User
        {
            Email = "admin@gmail.com",
            UserName = "user2",
            Password = "password2",   
            IsAdmin = true
        };

        return new List<User> { user1, user2 };
    }

    private static IEnumerable<Image> GetPreconfiguredImages(ApplicationDbContext context)
    {
        var album1 = context.Albums.First(a => a.Title == "Nature");
        var album2 = context.Albums.First(a => a.Title == "Travel");

        var image1 = new Image
        {
            Title = "Mountain View",
            Description = "Scenic mountain view",
            Extension = "jpeg",
            Content = Convert.FromBase64String(""),
            Likes = 0,
            Dislikes = 0,
            AlbumId = album1.AlbumId
        };

        var image2 = new Image
        {
            Title = "Beach Sunset",
            Description = "Beautiful sunset at the beach",
            Extension = "jpeg",
            Content = Convert.FromBase64String(""),
            Likes = 0,
            Dislikes = 0,
            AlbumId = album1.AlbumId
        };

        var image3 = new Image
        {
            Title = "Eiffel Tower",
            Description = "Iconic Eiffel Tower in Paris",
            Extension = "jpeg",
            Content = Convert.FromBase64String(""),
            Dislikes = 0,
            Likes = 0,
            AlbumId = album2.AlbumId
        };

        return new List<Image> { image1, image2, image3 };
    }

    private static IEnumerable<Album> GetPreconfiguredAlbums(ApplicationDbContext context)
    {
        var user1 = context.Users.First(u => u.UserName == "user1");
        var user2 = context.Users.First(u => u.UserName == "user2");

        var album1 = new Album
        {
            Title = "Nature",
            Description = "Beautiful nature images",
            UserId = user1.UserId
        };

        var album2 = new Album
        {
            Title = "Travel",
            Description = "Travel memories",
            UserId = user2.UserId
        };

        var album3 = new Album
        {
            Title = "Food",
            Description = "Delicious food pictures",
            UserId = user1.UserId
        };

        return new List<Album> { album1, album2, album3 };
    }
}